import React from 'react'
import SingleCard from './components/SingleCard'
import product from './data/product'

const App = () => {
  return (
    <div className='container'>
       <div className="row">
       {product.map((fd,i)=>{
          return <SingleCard title={fd.title}
          description={fd.description}
          photo={fd.image}
          price={fd.price}
          key={i}
          />
        })}
       </div>
    </div>
  )
}

export default App
